// src/components/VideoSection.tsx
import React from 'react';
import './style.css'; // Assuming you have a CSS file for styling

const VideoSection: React.FC = () => {
  return (
    <section className="video-section">
      <div className="video">
        <img src="path/to/video-thumbnail.jpg" alt="Interview" />
        <div className="video-overlay">
          <h2>Guess Who Doesn't Watch "House of the Dragon"</h2>
          <p>The Cast Reveal Who Actually Watches the Show</p>
          <span>4:12</span>
        </div>
      </div>
    </section>
  );
};

export default VideoSection;
